Rota do tipo 'POST' para criação de um novo usuário;

Obrigatório informar os seguintes campos:

- username: tipo 'string';
- password: tipo 'string';
- email: tipo 'string';
- professional_level: tipo 'string' -> campo opcional, caso não seja informado o valor `null` será atribuido automaticamente;
- kind_of_work: tipo 'string' -> campo opcional, caso não seja informado o valor `null` será atribuido automaticamente;

