Rota para criar departamentos

É necessário envio do token de autenticação de administrador;

- *Bearer ${token}*

Campos necessários para cadastro de um departamento:

- name: tipo 'string';
- description: tipo 'string';
- company_uuid: tipo 'string';

```response
{
	"uuid": "f4df9ca2-5d66-46e6-8480-2f2e7d7f949a",
	"name": "Ensino",
	"description": "Equipe responsável para ensinar os alunos",
	"company_uuid": "85b7393b-ad59-4550-964b-0aaf796243f1"
}
```

Rota para cadastrar uma empresa

É necessário envio do token de autenticação de administrador;

- *Bearer ${token}*

Campos necessários para cadastro:

- name: tipo 'string';
- opening_hours: tipo 'string' -> deve ser informado no seguinte modelo: "09:00";
- description: tipo 'string';
- sector_uuid: tipo 'string;

```response
{
	"uuid": "85b7393b-ad59-4550-964b-0aaf796243f1",
	"name": "Kenzie",
	"opening_hours": "09:00",
	"description": "Kenzie kenzie kenzie",
	"sector_uuid": "3854e74a-0a96-43dd-b44b-f884c08ff3a1"
}
```

### Campos obrigatórios
- name: deve ser uma string
- email: deve ser uma string
- password: deve ser uma string

### Retorno esperado

**STATUS 400 BAD REQUEST**

Quando algum dado é enviado com o tipo diferente.
```
{
	"message": {
		"password": [
			"Expected string, received number"
		]
	}
}
